export default (state = '', action) => {
  switch (action.type) {
    
    case 'INDEX_ME':
      return (
        <>
          Olá, {action.payload.name}!
          <br/>
          Seu e-mail é: {action.payload.email} e seu id é: {action.paylad.id}
        </>
      );

    default:
      return state;
  }
}
